import React, { useState } from 'react';
import './ClubRegister.css';
const ClubRegister = () => {
  const [formData, setFormData] = useState({
    cname: '',
    caname: '',
    cpname: '',
    cmail: '',
    cid: '',
    cmobile: '',
    cpassword: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const res = await fetch('http://localhost:3001/api/clubs/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(formData)
      });

      const result = await res.json();
      alert(result.message);

      if (res.ok) {
        window.location.href = '/login-club'; // Navigate to club login page
      }
    } catch (err) {
      console.error('Frontend error:', err);
      alert('Registration failed (Frontend)');
    }
  };

  return (
    <div className="container">
      <header>Club Registration</header>

      <form onSubmit={handleSubmit}>
        <div className="form first">
          <div className="details club">
            <span className="title">Details</span>

            <div className="fields">
              <div className="input-field">
                <label>Club Name</label>
                <input type="text" name="cname" value={formData.cname} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>Advisor Name</label>
                <input type="text" name="caname" value={formData.caname} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>President Name</label>
                <input type="text" name="cpname" value={formData.cpname} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>Club Email</label>
                <input type="email" name="cmail" value={formData.cmail} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>Club ID</label>
                <input type="number" name="cid" value={formData.cid} onChange={handleChange} required min="10000000" max="99999999" />
              </div>

              <div className="input-field">
                <label>Mobile Number</label>
                <input type="number" name="cmobile" value={formData.cmobile} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>Choose Password</label>
                <input type="password" name="cpassword" value={formData.cpassword} onChange={handleChange} required />
              </div>
            </div>
          </div>

          <button type="submit" className="submit">
            <span className="btnText">Submit</span>
          </button>

          <p>Back to <a href="/login-club" style={{ color: 'blue' }}>Login</a></p>
        </div>
      </form>
    </div>
  );
};

export default ClubRegister;
